import Axios from 'axios';
import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const Cryptodetail = () => {
    const { id } = useParams();
    const [ cryptoData, setCryptoData ] = useState({});
    const fetchData = async() => {
        console.log("NICE")
        await axios.get(`https://api.coingecko.com/api/v3/coins/markets?vs_currency=usd&order=market_cap_desc&per_page=50&page=1&sparkline=false&ids=${id}`)
        .then(res => {
            setCryptoData(res.data)
            console.log("Gadmoqachulia")
        })
        .catch(err => {
            console.log("ERR")
        })
    }
    useEffect(() => {
        fetchData();
    }, [])
    return (
        <div>
        <h1>{cryptoData[0].name}</h1>
        <h1>NICE</h1>
        </div>
    )
}

export default Cryptodetail;
